import React,{Component} from 'react'
import {Input,Button,Card} from 'antd'

class Comp_regit extends Component{

    render(){
        return(
            <div>
                <Card>
                    <Input/>
                </Card>
            </div>
        )
    }
}
export default Comp_regit
